import './SwipeItem.css';

function SwipeItem({key, background, title, button}) {
    <div key={key} className='swipe-item' style={{background:{background}}}>
        <div>
            {title}
        </div>
        <button>
            {button}
        </button>
    </div>
};

export default SwipeItem;
